// This is a calculation using the minimum function 
// It shows the Min Date in the selection

MIN([Close Date])

// This is a calculation using the maximum function 
// It shows the Max Date in the selection

MAX([Created Date])

// This is a Level of Detail Calculation 
// It shows the average value for sales 

{ FIXED [Close Date]: AVG([Calculation_463870818050838533])}

// This is an If Statement 
// It shows the managers name if a manager is selected 

IIF (COUNTD([Name (User)])=1, ATTR([Name (User)])+"'s team", "All teams")

//This is an If Statement 
// It shows only selected quarters to be labeled in the chart 

IF [Calculation_463870818076176400]<>'Other Qs' THEN DATETRUNC('quarter', [Close Date])
END

//This is an If Statement 
// It shows the amount for opportunities either closed or in the open pipeline

IF [Forecast Category]="Closed"
OR [Forecast Category]="Pipeline"
THEN [Amount]
END

//This is an If Statement combined with a Count Distinct function 
// It counts each opportunities if the opportunity is closed and won

IFNULL(COUNTD(IF  [Closed]=True
    AND  [Won]=True
THEN [Opportunity ID]
END),0)

//This is a nested IF Statement 
//It queries the data for the current quarter, previous quarter and same quarter last year 
//Doing so via two possible routes depending on if the data is past or present
//Looking at the difference in quarters between dates

//First, Query the data to see if the latest close date is before today's date
IF 
    {MAX([Close Date])} < TODAY() 

//IF the latest close date is before today's date, i.e. the data is past, then follow this route:
THEN
        //query the data for rows that have dates within the latest quarter and label them as current quarter
        (IF
            DATEDIFF('quarter', {MAX([CreatedDate (Opportunities)])}, [Close Date]) = 0
        THEN
            'Current Q'

        //query the data for rows that have dates within the previous quarter and label as previous quarter
        ELSEIF 
            DATEDIFF('quarter', {MAX([CreatedDate (Opportunities)])}, [Close Date]) = -1
        THEN
            'Previous Q'

        //query the data for rows that have dates of the same quarter last year and label as same quarter last year
        ELSEIF   
            DATEDIFF('quarter', {MAX([CreatedDate (Opportunities)])}, [Close Date]) = -4
        THEN
            'Same Q Last Year'

        // Label remaining quarters as other
        ELSE
            'Other Qs'

        END)

//IF the latest close date is greater than or equal to today's date, i.e. the data is present, then follow this route:
ELSE

        //query the data for rows that have dates within the latest quarter and label them as current quarter
        (IF
            DATEDIFF('quarter', TODAY(), [Close Date]) = 0
        THEN
            'Current Q'

        //query the data for rows that have dates within the previous quarter and label as previous quarter
        ELSEIF 
            DATEDIFF('quarter', TODAY(), [Close Date]) = -1
        THEN
            'Previous Q'

        //query the data for rows that have dates of the same quarter last year and label as same quarter last year
        ELSEIF   
            DATEDIFF('quarter', TODAY(), [Close Date]) = -4
        THEN
            'Same Q Last Year'

        // Label remaining quarters as other
        ELSE
            'Other Qs'

        END)

END

//This is a DatePart function combined with a DateTrunc function 
//It compares all Close Dates to show wich is the maximum year in a dataset 

DATEPART('year',{MAX(DATETRUNC('year',[Created Date]))})

// This is a calculation showing the average size of a deal

 SUM([Calculation_463870818050838533])/
[Calculation_463870818055323654]

//This is a DatePart function combined with a DateTrunc function 
// It shows week numbers restarting every quarter

FLOAT(DATEDIFF('week', DATETRUNC('quarter', [Close Date]),[Close Date])+1)

// This is a DateDiff function combined with a DateTrunc function
// It shows remaining days to the end of the quarter

DATEDIFF("day",TODAY(), dateadd("day", -1, dateadd("quarter", 1, DATETRUNC("quarter",TODAY()))))

// This is a DateTrunc function combined with a Max function
//It compares all Close Dates to show the max quarter in the dataset

IF  DATETRUNC('quarter', [Close Date])=DATETRUNC('quarter', {MAX([CreatedDate (Opportunities)])})
THEN [Calculation_463870818050838533]
END

// This is an If Statement
// It compares the goal defined by the user with the total sales for last quarter

IF SUM([Calculation_920986127781167105])>= [Parameters].[Parameter 1]
THEN  "Reached"
ELSE "Not Reached"
END

// This is a calculation
// It compares the total sales against the goal defined by the user

(SUM([Calculation_920986127781167105])-[Parameters].[Parameter 1])/
[Parameters].[Parameter 1]

